<h2> First, we will issue an SSL certificate from AWS Certificate Manager (ACM).</h2>
<ol>
<li>Go into <a href="https://ap-northeast-2.console.aws.amazon.com/acm/home?region=ap-northeast-2#/welcome" target="_blank"> AWS Certificate Manager (ACM)</a>.</li>
